@Component({
  selector: 'app-users-info',
  templateUrl: './users-info.component.html',
  styleUrls: ['./users-info.component.css']
})
export class UsersInfoComponent {

}
<div class="header">
    Existing Users
</div>
<table class="table table-striped bg-light">
    <tr>
    <th> User Id </th>
